import React from "react";
import logo from "../images/react_icon.png";

export default function Navbar(){
    return(
            <nav className = "nav">
            <img src = {logo} alt = "Logo" width="80px" className="nav--icon"/>
            <h3>ReactFacts</h3>
            <h4>React Course - Project 1</h4>
        </nav>
    )
}
